S, F, V = map(int, input('S, F, V:\t').split())if V > 100:    V = 100if V < 1:    V = 1if S < 1:    S = 1if S > V:    S = VS -= 1F -= 1matrix = []vertices = []used = [False for i in range(V)]def dfs(matrix, vertex_id, vertices, used):    vertices.append(vertex_id)    used[vertex_id] = True    vertices_amount = len(matrix)    for next_vertex_id in range(vertices_amount):        if bool(matrix[vertex_id][next_vertex_id]) and not used[next_vertex_id]:            dfs(matrix, next_vertex_id, vertices, used)if __name__ == "__main__":    counter = 0    while counter < V:        input_vector = list(map(int, input(f"{counter + 1}-я строка:\t").split()))        if (len(input_vector) != V):            print('Не верный ввод строки!')            continue        matrix.append(input_vector)        counter += 1    dfs(matrix, S, vertices, used)    print("YES" if F in vertices else "NO")